import React from 'react';
import { Navbar, NavItem, Icon, Button } from 'react-materialize';
import "./style.css";


function Header() {
    return (
        <Navbar
        className="app-header "
            alignLinks="right"
            className="fas fa-camera">
            brand={<a className="brand-logo FcClock "href="/">Well ToDo</a>}
            id="mobile-nav"
            menuIcon={<Icon>menu</Icon>}
            options={{
                draggable: true,
                edge: 'left',
                inDuration: 250,
                onCloseEnd: null,
                onCloseStart: null,
                onOpenEnd: null,
                onOpenStart: null,
                outDuration: 200,
                preventScrolling: true
            }}
        >
            <NavItem href="/">
                Sign In
            </NavItem>
            <NavItem href="/">
                Sign Up
            </NavItem>
        </Navbar>
    );
}

export default Header;
